import React, { Component, PropTypes } from 'react';

import styles from './MiniplayerSong.scss';

import main from '../Miniplayer/Miniplayer.scss';

import MiniplayerYoutube from '../MiniplayerYoutube/MiniplayerYoutube';

const NoPlay = `rp_selected ${styles.empty} ${main.minilayout} ${main.vertical} ${main.align}`;

const Replace = (s, f, r) => {
  if (s != null) {
    return s.replace(new RegExp(f, 'g'), r);
  }
  return false;
};

/* Lets animate our tiles for NoPlay */
class MiniplayerTiles {
  constructor() {
    this.animate = this.animate.bind(this);
    this.setupMiniPlayerTiles();
  }

  animate() {
    const now = Date.now();

    this.tiles.forEach((tile) => {
      const delta = tile.offset + now;
      const opacity = Math.sin(delta / 1000);
      return tile.el.setAttribute('style', `opacity: ${opacity}`);
    });

    // Throttle
    return setTimeout(() => requestAnimationFrame(this.animate)
            , 50);
  }

  setupMiniPlayerTiles() {
    this.tiles = [];

    return Array.from(document.getElementsByClassName(main.tile)).map(tile =>
            this.tiles.push({
              el: tile,
              offset: Math.random() * 10000,
            }));
  }

  render() {
    this.animate();
  }
}

class MiniPlayerArt {

  constructor(data) {
    this.art = this.art.bind(this);
    this.zoom = this.zoom.bind(this);
    this.fade = this.fade.bind(this);
    this.rotateIn = this.rotateIn.bind(this);
    this.flip = this.flip.bind(this);
    this.lightSpeed = this.lightSpeed.bind(this);
    this.data = data;
  }

  art() {
    const artwork = document.querySelector('artwork');
    const style = document.querySelector('#artwork');

    if ((this.data.song.title === 'Your music will resume shortly' || this.data.song.artist === 'Subscribe for all of the music with none of the ads')) {
      artwork.style.backgroundImage = 'url("data:image/png;base64,")';
      document.querySelector('html').classList.add('ad_present');
    } else {
      artwork.style.backgroundImage = `url(${Replace(this.data.song.albumArt, 's90', 's500')})`;
      if (document.querySelector('html').classList.contains('ad_present')) {
        document.querySelector('html').classList.remove('ad_present');
      }
    }

    style.innerHTML = `artwork:before {background-image:${artwork.style.backgroundImage} !important;}gradient:before {background-image: linear-gradient(180deg,rgb(0, 0, 0) 0,rgba(31, 29, 29, 0) 8.7%,hsla(0, 0%, 100%, 0) 50%,hsla(0, 0%, 92%, 0) 70%,rgba(197, 197, 197, 0))!important;margin-top: 20px;transform: translateY(-20px);}`;
  }

  // https://web-animations.github.io/web-animations-demos/#animate_css/ thanks :)
  zoom = (e, i) => {
    const k = [{ transform: 'scale3d(.3, .3, .3)  ', opacity: '0', offset: 0 },
            { transform: 'none', opacity: '1', offset: 1 }];
    const t = { duration: 300, iterations: i };
    return e.animate(k, t);
  }

  fade = (e, i) => {
    const k = [
            { opacity: '0', offset: 0 },
            { opacity: '1', offset: 1 }];
    const t = { duration: 300, iterations: i };
    return e.animate(k, t);
  }

  rotateIn = (e, i) => {
    const tO = e.style['transform-origin']; // eslint-disable-line
    const k = [{ transform: 'rotate3d(0, 0, 1, -200deg)', opacity: '0', transformOrigin: 'center', offset: 0 },
            { transform: 'none', opacity: '1', transformOrigin: 'center', offset: 1 }];
    const t = { duration: 300, iterations: i };
    return e.animate(k, t);
  }

  flip = (e, i) => {
    const k = [
            { transform: 'perspective(400px) rotate3d(0, 1, 0, -360deg)', offset: 0 },
            { transform: 'perspective(400px) translate3d(0, 0, 150px) rotate3d(0, 1, 0, -190deg)', offset: 0.4 },
            { transform: 'perspective(400px) translate3d(0, 0, 150px) rotate3d(0, 1, 0, -170deg)', offset: 0.5 },
            { transform: 'perspective(400px) scale3d(.95, .95, .95)', offset: 0.8 },
            { transform: 'perspective(400px)', offset: 1 }];
    const t = { duration: 300, iterations: i, easing: 'ease-in' };
    return e.animate(k, t);
  }

  lightSpeed = (e, i) => {
    const k = [
            { transform: 'translate3d(100%, 0, 0) skewX(-30deg)', opacity: '0', offset: 0 },
            { transform: 'skewX(20deg)', opacity: '1', offset: 0.6 },
            { transform: 'skewX(-5deg)', opacity: '1', offset: 0.8 },
            { transform: 'none', opacity: '1 ', offset: 1 }];
    const t = { duration: 300, iterations: i };
    return e.animate(k, t);
  }
}

export default class MiniplayerSong extends Component {
  static propTypes = {
    // TODO: fill out the sub fields
    song: PropTypes.object, // eslint-disable-line react/forbid-prop-types
    youtube: PropTypes.string,
  }

  static defaultProps = {
    song: {},
    youtube: null,
  };

  renderYoutube() {
    const { youtube, state, actions, hasYoutube } = this.props; // eslint-disable-line

    const not_found = youtube === 'No YouTube video found'; // eslint-disable-line

    /**
     * Did we fullscreen? If so then we need to disable back fullscreen
     * because only fullscreen is allowed for Youtube videos upon clicking
     */
    if (document.querySelector('body').classList.contains('fullscreen')) {
      actions('DockYoutubeFullScreen', false);
    }

    if ((not_found || hasYoutube === false)) { // eslint-disable-line
      return '';
    }
    return <MiniplayerYoutube actions={actions} state={state} youTubeID={youtube} />;
  }

  renderSong() {
    const randomAnimation = (where, radiant, i) => {
      const animations = [
        function () { // eslint-disable-line
          where.zoom(radiant, i);
        },
        function () { // eslint-disable-line
          where.fade(radiant, i);
        },
        function () { // eslint-disable-line
          where.rotateIn(radiant, i);
        },
        function () { // eslint-disable-line
          where.flip(radiant, i);
        },
        function () { // eslint-disable-line
          where.lightSpeed(radiant, i);
        },
      ];

      const generate = animations[Math.floor(Math.random() * animations.length)];
      return generate.call();
    };


    /**
     * Load our song artwork and animate it in with randomAnimation :)
     * Notes due to event by playback time i.e state `playing` we have to onload MiniPlayerArt
     * when a new render() is processed otherwise an endless loop of animations that never
     * complete occurs. Can i get a Scooby snack?
     */
    const artLoadWAnimation = () => {
      const artwork = new MiniPlayerArt(this.props);
      const art = document.querySelector('artwork');
      artwork.art();

      /**
       * lets use more than one animation
       */
      return randomAnimation(artwork, art, 1); // eslint-disable-line
    };

    const { song } = this.props;

    const SongPlay = `rp_selected ${main.minilayout} ${main.vertical} ${main.align} ${main.player}`; // eslint-disable-line

    /* eslint-disable jsx-a11y/no-static-element-interactions */
    return (
      <section className="rp_selected" onLoad={artLoadWAnimation}>

        <div className={main.anim}>
          <div className={main.align}>
            <figure data-artwork={song.albumArt} className={styles.image}>
              <img className={main.art} src={song.albumArt} width="64" alt="Cover Art" />
            </figure>
          </div>
        </div>

        <div className={SongPlay}>
          <div className={main.pos_rel}>
            <div className={main.ts_p} >
              <span className={main.fPDils}>{song.title}</span>
              <span className={main.fPDils}>{song.artist}</span>
              <span className={main.fPDils}>{song.album}</span>
            </div>
          </div>
        </div>
        {this.renderYoutube()}
      </section>
    );
    /* eslint-enable jsx-a11y/no-static-element-interactions */
  }

  renderNoSong() { // eslint-disable-line consistent-return
    const { actions, state } = this.props; // eslint-disable-line

    const rollDice = () => {
      actions('rollDice');
      document.querySelector('[data-reactroot]').classList.add(main.rolledDice);
    };

    // Additional statement to ensure
    if (state === 'stopped') {
      // Tiles Setup on the dom
      const rows = [];
      let i = 0; // eslint-disable-line
      const len = 64;

      while (++i <= len) rows.push(i); // eslint-disable-line

      // Apply Animation construct
      const animation = new MiniplayerTiles();

      const rendAnimate = () => {
        animation.setupMiniPlayerTiles();
        animation.animate();
      };

      if (document.readyState === 'interactive') {
        requestAnimationFrame(rendAnimate);
        /*
         // Make sure dom is completed
         let readyStateChecker = setInterval(function () {
         if (document.readyState === "complete") {
         // Lets Animate :D

         clearInterval(readyStateChecker);
         }
         }, 10);*/
      }

      document.querySelector('gradient').classList.add('diced');
      document.querySelector('body').classList.add('diced');

      // dom is marked completed so we need to re-do things
      if (document.readyState === 'complete') {
        cancelAnimationFrame(rendAnimate);
        const rendAnimateAgain = () => {
          animation.animate();
        };

        /**
         * check if tile aren't present and remove any selected elements while removing
         * artwork including any visuals to be on the off state;
         */
        const Checker = setInterval(() => {
          if (document.querySelector(main.tile) === null) {
            if (document.querySelector('.hold').classList.contains('rp_selected')) {
              document.querySelector('.hold').classList.remove('rp_selected');
            }

            if (document.querySelector('.visual').classList.value.match('__on')) {
              document.querySelector('.visual label').click();
            }

            // Lets Animate again :D
            const last = setInterval(() => {
              requestAnimationFrame(rendAnimateAgain);
              cancelAnimationFrame(rendAnimateAgain);
              clearInterval(last);
            }, 2500);

            // requestAnimationFrame(rendAnimateAgain);
            clearInterval(Checker);
          } else {
            clearInterval(Checker);
            cancelAnimationFrame(rendAnimateAgain);
          }
        }, 10);

        cancelAnimationFrame(rendAnimateAgain);
        document.querySelector('#artwork').innerHTML = '';
      }

      return (<div className={NoPlay}>
        <div className={`${main.align} ${main.tiles}`}>
          {
            rows.map(i => <div className={main.tile} key={i} />) // eslint-disable-line
          }
        </div>
        <div className={main.flex} />
        <dice id="dice" className={`${main.dice} ${main.flex_center} ${main.minilayout} ${main.self_center}`}>
          <svg onClick={rollDice} viewBox="0 0 24 24" preserveAspectRatio="xMidYMid meet">
            <g>
              <path
                fill="#000000"
                d="M19,3H5C3.9,3,3,3.9,3,5v14c0,1.1,0.9,2,2,2h14c1.1,0,2-0.9,2-2V5C21,3.9,20.1,3,19,3z M8,9.5 C7.2,9.5,6.5,8.8,6.5,8S7.2,6.5,8,6.5S9.5,7.2,9.5,8S8.8,9.5,8,9.5z M12,13.5c-0.8,0-1.5-0.7-1.5-1.5s0.7-1.5,1.5-1.5 s1.5,0.7,1.5,1.5S12.8,13.5,12,13.5z M16,17.5c-0.8,0-1.5-0.7-1.5-1.5s0.7-1.5,1.5-1.5s1.5,0.7,1.5,1.5S16.8,17.5,16,17.5z"
              />
            </g>
          </svg>
        </dice>
        <div className={`${main.flex} ${main.minilayout} ${main.center}`}>No song playing</div>
      </div>
      );
    }
  }

  render() {
    const { state } = this.props; // eslint-disable-line

    const disabled = state === 'stopped';

    if (disabled) {
      return this.renderNoSong();
    }
    document.querySelector('gradient').classList.remove('diced');
    document.querySelector('body').classList.remove('diced');

    if (document.querySelector('.hold') != null) {
      document.querySelector('[data-reactroot]').classList.remove(main.rolledDice);
    }


    if (document.querySelector('.hold') != null) {
      if (!document.querySelector('.hold').classList.contains('rp_selected')) {
        document.querySelector('.hold').classList.add('rp_selected');
      }
    }

    if (!disabled) {
      return this.renderSong();
    }
    document.querySelector('gradient').classList.add('diced');
    document.querySelector('body').classList.add('diced');

    if (document.querySelector('.hold').classList.contains('rp_selected')) {
      document.querySelector('.hold').classList.remove('rp_selected');
    }

    return this.renderNoSong();
  }
}
